import React from 'react';
import { VStack } from '@chakra-ui/layout';
import { FormControl, FormLabel } from '@chakra-ui/form-control';
import { Input } from '@chakra-ui/input';

const Login = () => {
  return (
    <VStack spacing="5px">
      <FormControl>
        <FormLabel></FormLabel>
        <Input />
      </FormControl>
    </VStack>
  );
}

export default Login;
